/*
 * @brief set l'indice d'animation
 */
void setIndexAnim(uint8_t index){
	indexAnim = index;
}

/*
 * @brief incrémente l'indice d'animation 
 * et le remet à 0 si il dépasse le nombre d'image dans l'animation
 */
void incrementIndexAnim(void){
	indexAnim++;
	if(indexAnim > 3)
		indexAnim = 0;
}

/*
 * @brief get l'indice d'animation
 * @retval indexAnim
 */
uint8_t getIndexAnim(void){
	return indexAnim;
}

