uint16_t *  stateMachine_animation(playerStatus_e state)
{
	static playerStatus_e prev_state;
	uint16_t * anim;
	switch(state)
	{
		case IDLE:
			if(prev_state != state)
				indexAnim = 0;
			anim = idle[0];
			break;

		case RUN:
			if(prev_state != state)
				indexAnim = 0;
			anim = run[indexAnim];
			indexAnim = (indexAnim++) % 4;
			break;

		case JUMP:
			if(prev_state != state)
				indexAnim = 0;
			anim = jump[indexAnim];
			if(indexAnim >= 3)
				indexAnim = 2;
			break;

		case FALL:
			if(prev_state != state)
				indexAnim = 0;
			anim = fall[indexAnim];
			if(indexAnim >= 5)
				indexAnim = 4;
			break;
		
		case LAND:
			if(prev_state != state)
				indexAnim = 0;
			anim = land[indexAnim];
			//mettre state � IDLE
			break;

		case SHOOT:
			anim = idle[0];
			indexAnim = 0;
			break;

		case DAMAGED:
			anim = idle[0];
			indexAnim = 0;
			break;

		case DEATH:
			anim = idle[0];
			indexAnim = 0;
			break;

		default:
			anim = idle[0];
			indexAnim = 0;
			break;
	}
	prev_state = state;
	return anim;
}
